def get_shortcode_by_country_and_city_en_name(country_en_name):
    for k,v in location_dict.items():
        if country_en_name.lower().replace(" ", "").replace("-", "") in v['pool']:
            return k
    return None

def get_shortcode_by_country_cn_name(country_cn_name):
    for k,v in location_dict.items():
        if v.get('cn_name')==country_cn_name:
            return k
    return None

def get_shortcode_by_country_tag_name(country_tag_name):
    for k,v in location_dict.items():
        if v.get('tag_name')==country_tag_name:
            return k
    return None

def get_shortcode(s):
    s=s.strip()
    for c in s:
        if ('\u4e00' <= c <= '\u9fa5'):
            return get_shortcode_by_country_cn_name(s)
    if len(s)==3 and s.isupper():
        return get_shortcode_by_country_tag_name(s)
    return get_shortcode_by_country_and_city_en_name(s)









